import './App.css';
import {useState} from 'react';

function App() {
  

  return (
    <div className="App">
        <h1>Increment & Decrement </h1>

        <div className="pro" >
          <button onClick={decrementchangeHandler} className='btn'>-</button>

          <div className="val" > {raw} </div>

          <button onClick={incrementchangeHandler} className='btn'>+</button>
        </div>

        <button onClick={submitHandler} className='btn1' >Reset</button>
    </div>
  );
}

export default App;
